import {Switch, Route, Link} from 'react-router-dom'
import './App.css';;
import Project from './components/Project'

function App() {
  return (
    <div className="App">
    <Project />

    <Switch>
      <Route exact path='/add-project' render={(props)=> <Project {...props}/>}/>
    </Switch>


    </div>
  );
}

export default App;
